INSERT INTO survey_player VALUES (8, 8, 0.00, 8, 1, 1, 'f', 'f', NULL, '', 25, 'männlich', 'wenn man immer nur die 2 Aufträge mit der Lieferzeit von 10 Tagen auswählte konnte man einen durchgängigen Produktionsfluss erzeugen und die Kosten minimieren. Das habe ich durch die Probephase herausgefunden.
INSERT INTO survey_player VALUES (6, 6, 0.00, 6, 1, 1, 'f', 'f', NULL, '', 22, 'männlich', 'zu 1) 1. Versuch der Kostenminimierung, indem ich Lagerkosten und vor allem Verspätungskosten vermeide
INSERT INTO survey_player VALUES (4, 4, 0.00, 4, 1, 1, 'f', 'f', NULL, '', 26, 'männlich', '1,1) Ich habe mich nach den Zeitraum bis zum Auslieferungsdatum bezogen und auf Grund dessen meine Entscheidungen getroffen
INSERT INTO survey_player VALUES (12, 12, 0.00, 12, 1, 1, 'f', 'f', NULL, '', 21, 'weiblich', '1. Meine Logik bezog sich auf die Kostenminimierung. Ich entschied mich jeglich für jene AUfträge die mir keine oder nur geringe Kosten verursachten. Ich habe mich bei der Duchführungsphase auch weniger AUfträge konzentriert, um Kosten zu sparen.
INSERT INTO survey_player VALUES (21, 21, 0.00, 21, 1, 1, 'f', 'f', NULL, '', 28, 'männlich', '1.1 Nur die gerade anstehenden Produzieren lassen, da die späteren zu teuer sind.
INSERT INTO survey_player VALUES (18, 18, 0.00, 18, 1, 1, 'f', 'f', NULL, '', 24, 'weiblich', 'Ich habe die zentrale Information des Lieferdatums angewendet. Wenn eine Lieferung nicht rechtzeitig ankommt dann entstehen Kosten, so habe ich NUR die Aufträge freigegeben die die geringste Anzahl an Tagen hatten bis zu ihrem Lieferdatum, was meist den 10 Tagen entsprach.', 'BHS (berufsbildende hohere Schule)', 'Fakultät für Betriebswirtschaft', 'Ja', 2, 6, 7, 2, 7, 6, 4, 6, 1, 6, 6, 2, 6, 7, 4, NULL, 'Ich war mir unsicher wieviele Aufträge gleichzeitig ich freigeben sollte, so habe ich nur jene freigegeben die bis zum gleichen Tag fertig produziert werden sollten.', 2, 2, 6, 6, 5, 6, 5, 'f', 'f', 'f', 't', 't', 2, 1, 1);
INSERT INTO survey_player VALUES (7, 7, 0.00, 7, 1, 1, 'f', 'f', NULL, '', 23, 'männlich', '1.1 Habe immer 2 Aufträge freigegeben, mit 10 Tagen Lieferzeit. Somit habe ich die Kosten auf 0 gehalten.
INSERT INTO survey_player VALUES (2, 2, 0.00, 2, 1, 1, 'f', 'f', NULL, '', 25, 'männlich', 'Was war wichtig und muss zuerst fertig sein. Differenz Lager - Verspätung.
INSERT INTO survey_player VALUES (11, 11, 0.00, 11, 1, 1, 'f', 'f', NULL, '', 20, 'weiblich', '1. Der Auftrag, der am frühesten fertig werden musste, bekam meine Freigabe. Da jede Runde 10 Tage dauert und die Produktionsphase der meisten Aufträge 10 Tage beträgt, habe ich diese Freigabe gewählt. So schafft man keine Lagerung, aber auch keine Verspätung. 
INSERT INTO survey_player VALUES (16, 16, 0.00, 16, 1, 1, 'f', 'f', NULL, '', 23, 'weiblich', 'Aufträge mit Lieferzeit länger als in 10 Tagen haben zu Kosten geführt (in Probephase), deshalb habe ich diese nicht mehr angenommen sondern lediglich diese mit "in 10 Tagen" und somit versucht keine Kosten zu verursachen', 'Universität/Fachhochschule', 'Fakultät für Betriebswirtschaft', 'Ja', 2, 7, 5, 4, 2, 5, 4, 3, 1, 4, 1, 6, 7, 7, 2, NULL, 'Unsicher bezüglich Aufträgen die heute geliefert werden sollten - habe diese nicht mehr angenommen ', 2, 1, 3, 3, 6, 7, 7, 't', 't', 'f', 't', 't', 2, 1, 1);
INSERT INTO survey_player VALUES (15, 15, 0.00, 15, 1, 1, 'f', 'f', NULL, '', 20, 'weiblich', '1. 1 ich habe auf den Liefertermin geschaut und diese Aufträge erledigt, die in 10 Tagen geliefert werden müssen, weitere Aufträge habe ich nicht freigegeben, da diese ansonsten nur in der Warteschleife landen
INSERT INTO survey_player VALUES (5, 5, 0.00, 5, 1, 1, 'f', 'f', NULL, '', 23, 'männlich', 'Die verweildauer im System war durchschnittlich 6.75, also gehen sich normalerweise 2 Aufträge aus, wobei es zu keiner verspätung oder wartezeit kommen sollte. Wenn also jedes mal 2 aufträge freigegeben werden sind alle zufrieden. DIe Logik wurde nicht geändert. Die Zentrale Info war eigentlich das Lieferdatum, das nicht überschritten werden sollte. ICh habe erwartet, dass es anspruchsvoller und kompliziert wird die Aufträge zu handeln aber sonst gab es keine Überraschungen. Keine Probleme oder Schwierigkeiten.', 'AHS (allgemein bildende hohere Schule)', 'Fakultät für Betriebswirtschaft', 'Ja', 8, 7, 6, 3, 5, 4, 2, 6, 4, 7, 5, 5, 7, 6, 6, NULL, 'Ob die Aufträge in gleicher weise wiederkehren oder nicht. Ich habe immer wieder kontrollier tob es sich an einem Tag um zwei Aufträge handelt oder nicht und wann der Liefertermin dazu ist-', 1, 1, 7, 7, 1, 7, 7, 'f', 'f', 'f', 't', 't', 7, 1, 1);
INSERT INTO survey_player VALUES (10, 10, 0.00, 10, 1, 1, 'f', 'f', NULL, '', 22, 'männlich', 'Ich habe mir die durchschnittliche Zeit im Lager angeschaut und mit den noch offenen Aufträgen verglichen, um herauszufinden, wie ich die Produktionslinien am besten freigeben kann.
INSERT INTO survey_player VALUES (3, 3, 0.00, 3, 1, 1, 'f', 'f', NULL, '', 25, 'weiblich', 'Ich habe in der Proberunde probiert, was passiert, wenn ich immer nur die ersten 2 Zeilen anklicke und da nie Kosten entstanden sind, bin ich bei dieser Strategie geblieben. Überraschend war, dass es nie eine Änderung gegeben hat und dass ich das Gefühl hatte, es geht nie zu Ende; ich mache immer nur dasselbe', 'Universität/Fachhochschule', 'Fakultät für Volkswirtschaft und Statistik', 'Ja', 4, 6, 6, 3, 4, 5, 2, 4, 3, 5, 5, 6, 6, 6, 6, NULL, 'Ich habe mich irgendwann gefragt, ob es nach Zeit geht und einfach irgendwann vorbei ist, oder ob ich eine bestimmte Menge an Aufträgen abgearbeitet haben muss. Mir sind Zweifel gekommen, ob ich etwas falsch mache, denn so einfach kann es einfach nicht sein.', 1, 1, 7, 1, 0, 7, 7, 'f', 'f', 'f', 't', 'f', 7, 1, 1);
INSERT INTO survey_player VALUES (1, 1, 0.00, 1, 1, 1, 'f', 'f', NULL, '', 19, 'weiblich', '1. 1. schauen, dass so wenig versätungen vorkommme. Daher habe ich immer geschaut ein Produkt mit schnellen Beendigungszeitraum und eines mit bisschen längeren freizugeben. Hat am Anfang noch nicht gut  funktioniert, habe aber mit der Zeit meien Taktik verfeiert und Erfolge gesehen. Lieber waren mir Lagerkosten als Verspätungskosten, weil diese sind kaum zu verhindern.
INSERT INTO survey_player VALUES (20, 20, 0.00, 20, 1, 1, 'f', 'f', NULL, '', 26, 'männlich', '1.1. Nach der Probephase habe ich gemerkt, dass ich eigentlich immer nur die 2 ersten Aufträge auswählen muss um kenie Kosten entstehen zu lassen. 
INSERT INTO survey_player VALUES (19, 19, 0.00, 19, 1, 1, 'f', 'f', NULL, '', 20, 'männlich', 'Bei der Probephase bemerkt, dass keine Kosten anfallen wenn man bei einer durchschnittliche System Zeit von 6.75 und einem Lieferdatum in 10 Tagen, immer 2 Produkte in die Produktion lässt.
INSERT INTO survey_player VALUES (17, 17, 0.00, 17, 1, 1, 'f', 'f', NULL, '', 20, 'männlich', '1.1. - Habe das Prinzip versucht das Prinzip Just-in-Time anzuwenden, sodass alle Zeiten, wofür Kosten entstehen konnten gering gehalten wurden bzw. minimiert wurden.
INSERT INTO survey_player VALUES (25, 4, 0.00, 25, 2, 1, 'f', 'f', NULL, '', 21, 'weiblich', '1.1. Um die Kosten so gering wie möglich zu halten, habe ich nicht zu viele Aufträge in Bearbeitung gegeben, um die Wartezeit kosten sowie die Lagerkosten zu minimieren. 
INSERT INTO survey_player VALUES (24, 3, 0.00, 24, 2, 1, 'f', 'f', NULL, '', 21, 'männlich', '1.1 Ich habe nur die Aufträge freigegeben, die in der nächsten Runde gebraucht wurden, was immer 2 Aufträge waren, was durch die gegebene durchschnittliche Zeit im System möglich erschien. Diese Logik hat sich bereits in der Proberunde bewährt.
INSERT INTO survey_player VALUES (13, 13, 0.00, 13, 1, 1, 'f', 'f', NULL, '', 25, 'weiblich', '1.Ich habe mir gedacht, dass wenn 2 Aufträge jeweils 10Tage dauern und die Zeit bis zu der nächsten Runde 10 Tage sind, ist die Maschine mit 2 Aufträgen ausgeschöpft und es werden sich quasi Warteschlangen bilden, wenn ich noch einen Auftrag entgegennehme.
INSERT INTO survey_player VALUES (22, 1, 0.00, 22, 2, 1, 'f', 'f', NULL, '', 26, 'männlich', 'Das wichtigste Ziel war, Verspätungen zu verhindern, da diese 15 Punkte kosten. Zuerst habe ich probiert mehr wie zwei Aufträge einzugeben, da ich das einfache Prinzip noch nicht erkannt hatte. Da ich gesehen habe, dass die Kosten 0 sind und es niemals zu einer Verspätung kommt, wenn man die zwei Aufträge mit dem frühest notwendigen Fertigstellungszeitraum eingibt, habe ich das über das ganze Experiment dann so durchgeführt. Die zentrale Information dabei war eben  der Zeitpunkt, an dem die Aufträge fertig sein müssen. Die Überraschung war, dass die Aufgabe so winfach war. Daher gab es werder Probleme noch Schwierigkeiten.', 'Universität/Fachhochschule', 'Fakultät für Betriebswirtschaft', 'Ja', 8, 6, 5, 4, 6, 4, 5, 3, 5, 5, 4, 3, 5, 4, 6, NULL, 'Gar keine, das Experiment ist viel zu einfach', 1, 1, 7, 7, 7, 7, 7, 't', 't', 'f', 't', 't', 3, 2, 2);
INSERT INTO survey_player VALUES (9, 9, 0.00, 9, 1, 1, 'f', 'f', NULL, '', 29, 'männlich', 'Dauer der Auftrages und wann dieser fertig sein muss.
INSERT INTO survey_player VALUES (14, 14, 0.00, 14, 1, 1, 'f', 'f', NULL, '', 28, 'männlich', 'Zuerst habe ich nur auf die Dauer geschaut, dann wurde auch das Lieferdatum miteinbezogen. Ich hatte nicht wirklich eine Logik da es mir eher schwer gefallen ist hier ein gewisses System zu entwickeln. 
INSERT INTO survey_player VALUES (30, 9, 0.00, 30, 2, 1, 'f', 'f', NULL, '', 21, 'männlich', 'Ich habe das Prinzip nicht verstanden wie sich die Kosten für die Aufträge summieren und habe ab dem Zeitpunkt an dem die Kosten so hoch waren dass meine Auszahlung gleich 0 ist aufghört  logische Entscheidungen für die Auftragsabwicklung zu treffen.', 'Allgemein bildende Pflichtschule', 'Fakultät für Betriebswirtschaft', 'Ja', 6, 5, 5, 3, 5, 3, 3, 6, 6, 6, 4, 4, 5, 6, 6, NULL, 'Um erhlich zu sein habe ich nur gehofft dass die Kosten für die Aufträge nicht meinen Gewinn gleich 0 setzten', 4, 4, 4, 4, 2, 4, 4, 'f', 't', 't', 'f', 'f', 2, 2, 2);
INSERT INTO survey_player VALUES (41, 20, 0.00, 41, 2, 1, 'f', 'f', NULL, '', 20, 'weiblich', '1. Meine Logik war es einfach lieber weniger Aufträge anzunehmen, anstatt unnötig viele Kosten entstehen zu lassen. Diese "Logik" habe ich gesamten Verlauf des Experiments angewandt, in dem ich immer nur die zwei Aufträge freigegeben habe, welche zum ehseten Zeitpunkt fällig waren, also immer die ersten zwei Aufrtäge der aufgeführten Liste. 
INSERT INTO survey_player VALUES (29, 8, 0.00, 29, 2, 1, 'f', 'f', NULL, '', 20, 'männlich', 'den zugesagten Liefertermin, den Auftragseingang und die durchschnittliche Zeit im System betrachten. Entsprechend diesen Daten dann den Auftrag freigeben oder eben nicht. 
INSERT INTO survey_player VALUES (39, 18, 0.00, 39, 2, 1, 'f', 'f', NULL, '', 22, 'männlich', 'Habe geguckt wieviele kosten entstehen bei den einzelnen Freigaben. Habe meine Taktik im Laufe geändert. Habe geguckt, wie lang die durchschnittliche Dauer ist und versucht so wenig wie möglich auf lager zu behalten.
INSERT INTO survey_player VALUES (43, 22, 0.00, 43, 2, 1, 'f', 'f', NULL, '', 24, 'männlich', '1.1 Analysieren des bisherigen Systems
INSERT INTO survey_player VALUES (42, 21, 0.00, 42, 2, 1, 'f', 'f', NULL, '', 25, 'weiblich', 'Ich habe immer auf die durchschnittliche Zeit geachtet und da diese konstat bei 6,75 blieb, habe ich immer nur die Auftrage gewählt, die in 10 Tagen fällig waren, damit es zu keine Kosten durch zu frühe Produktion kommt.
INSERT INTO survey_player VALUES (32, 11, 0.00, 32, 2, 1, 'f', 'f', NULL, '', 24, 'männlich', 'In der Probephase habe ich gesehen, dass maximal 2 Aufträge zu Kosten von 0€ führen. Da ich auch andere Auftragslagen im Warteraum als Szenarien durchgespielt habe, konnte ich sehen, dass dies zu unerwünschten Kosten wie etwa Verspätungskosten und/oder Wartekosten führt. Daraufhin war es für mich klar, dass in der Durchführungsphase genau das erstgenannte System durchgeführt werden muss, damit die Kosten konstant bei 0€ bleiben und man sowieso immer genau 2 Aufträge in 10 Tagen beim Kunden auszuliefern hat. Ich habe meine Logik aus diesem Grund nie geändert.
INSERT INTO survey_player VALUES (33, 12, 0.00, 33, 2, 1, 'f', 'f', NULL, '', 26, 'männlich', 'Gerade so viel produzieren, wie nötig. möglichst keine lagerbestände. lagerbestände so hoch, dass ein verspätungsrisiko aufgrund von löängerer zeit im system gering ist.
INSERT INTO survey_player VALUES (23, 2, 0.00, 23, 2, 1, 'f', 'f', NULL, '', 24, 'männlich', 'Ich habe mithilfe der Proberunde eine Strategie "erarbeitet". Ich habe überlegt die Logik zu ändern, da der Produktionsprozess meines Wissens nach 6,25 Tage von einem Auftrag gedauert hat. Dadurch würden 2 Prozesse 12 Tage benötigen, eine Periode bestand aber nur aus 10 Tagen. Keine Ahnung, warum das nicht relevant wurde, aber da sich nie Kosten ergeben haben, bin ich bei meiner Strategie geblieben, immer die als nächstes auszuliefernden Aufträge zu produzieren. Vielleicht lag da aber auch ein Verständnisfehler des Experiments auf meiner Seite vor.
INSERT INTO survey_player VALUES (36, 15, 0.00, 36, 2, 1, 'f', 'f', NULL, '', 19, 'weiblich', '1.1 Ich habe nur die Aufträge freigegeben, die in 10 Tage geliefert werden soll.
INSERT INTO survey_player VALUES (38, 17, 0.00, 38, 2, 1, 'f', 'f', NULL, '', 22, 'weiblich', 'Ich habe verschieden Szenarien in der Probephase ausprobiert um zu sehen in welchen Fällen Kosten enstehen. Nach mehrmaligem probieren kam ich zum Schluss dass ich nur die ersten zwei Aufträge freigeben sollte, da sonst Wartezeitkosten entstehen und diese sich über die ganzen Runden anfallen. Ich habe meine Logik im Laufe der DUrchführung nicht geändert, da dies die beste Entscheidung var. Die zentrale Information war das Lieferdatum für meine Entscheidung. ', 'AHS (allgemein bildende hohere Schule)', 'Fakultät für Betriebswirtschaft', 'Ja', 5, 5, 2, 2, 2, 6, 6, 6, 6, 2, 6, 6, 5, 6, 3, NULL, '"Vorausproduzieren" führte zu erhöhten Kosten, was mich überrascht hat, auch wenn es auf der Anleitung stand, schließlich könnten ja Probleme auftreten und bei der Produktion etwas schief gehen, sodass vll Just in time Produktion doch nicht immer sinnvoll ist. Ich fand das Experiment nicht sehr realitätsbezogen um ehrlich zu sein.', 1, 1, 1, 1, 0, 7, 7, 'f', 'f', 'f', 't', 't', 2, 2, 2);
INSERT INTO survey_player VALUES (35, 14, 0.00, 35, 2, 1, 'f', 'f', NULL, '', 21, 'männlich', '1. Ich bin einfach intuitiv vorgegangen, dahinter steckte keine bestimmte Logik.
INSERT INTO survey_player VALUES (28, 7, 0.00, 28, 2, 1, 'f', 'f', NULL, '', 27, 'männlich', '1.1 Die als nächstes anstehenden Aufträge zuerst
INSERT INTO survey_player VALUES (27, 6, 0.00, 27, 2, 1, 'f', 'f', NULL, '', 24, 'weiblich', '1.1. Auftrage welche bald anstehen habe ich als erstes gewählt (damit keine Verspätung auftritt). Dann habe ich mich auf die Auftr#ge konzentriert, wo noch viel Zeit geblieben ist, weil ich mir sicher war, dass diese dann rechtzeitig fertig sind. Mir waren die Lagerkosten lieber als eine Verspätung
INSERT INTO survey_player VALUES (26, 5, 0.00, 26, 2, 1, 'f', 'f', NULL, '', 25, 'weiblich', '1. Ich habe in der Testphase ausprobiert, ob es irgendetwas bringt, wenn ich die durchschnittliche Produktionszeit verringere. Das hat aber nur zu mehr Kosten geführt, daher war es die logische Konsequenz, alles beim Alten zu belassen. 
INSERT INTO survey_player VALUES (37, 16, 0.00, 37, 2, 1, 'f', 'f', NULL, '', 27, 'männlich', 'Die Aufträge ausgewählt die vom Datum her am dringlichsten waren, und die gesamte durchschnittliche Dauer von 6,75 vernachlässigt. Als klar war, 2 Aufträge auch in 10 Tagen fertig werden immer 2 Aufträge/Periode erteilt. 
INSERT INTO survey_player VALUES (31, 10, 0.00, 31, 2, 1, 'f', 'f', NULL, '', 21, 'männlich', '1. Ich habe lediglich die dringlichsten Aufträge bearbeitet, alle anderen kamen erst danach.
INSERT INTO survey_player VALUES (34, 13, 0.00, 34, 2, 1, 'f', 'f', NULL, '', 24, 'weiblich', '1. Zuerst die Aufträge der Reihe nach - aber wenn dann einer eh schon zu spät ist, habe ich lieber den nächsten freigeschalten, sonst wäre ja bei beiden eine Verspätung. 
INSERT INTO survey_player VALUES (40, 19, 0.00, 40, 2, 1, 'f', 'f', NULL, '', 26, 'männlich', 'Mein Absicht war es die Aufträge so zeitig wie möglich fertig zustellen. Mein Autragsbuch hatte zu jeder Phase die gleiche Struktur. Alle 10 Tage erhielt ich zwei Aufträge. Bei einer durchschnittlichen Produktionszeit von 6,75 bedeutet dies für meine Entscheidung, dass es nicht möglich ist in einer Spielperiode mehr als einen Autrag fertig zustellen. Da ich aber alle 10 Tage zwei Aufträge ausliefern musste und die Kosten für verspätete Auslieferung 15€ betragen, war die günstigste Alternative eine akutellen Auftrag, der in 10 Tagen ausgeliefert werden muss zu produzieren und einen zweiten Autrag der in 20 Tagen ausgeliefert werden muss in die Warteschlange zu geben. 
